data:
  definition: value obtained as the result of the operation made for the purpose of
    assigning, from the observed values in a sample, numerical values to the parameters
    of the distribution chosen as the statistical model of the population from which
    this sample is taken
  examples: []
  notes:
  - The result may be expressed either as a single numerical value, a point estimate,
    or as a confidence interval.
